import sys
import time

def fail(p):
    m, j = len(p), 0
    l = [0]*m
    for i in range(1, m):
        while j > 0 and p[i]!=p[j]:
            j = l[j-1]
        if p[i] == p[j]:
            j+=1
            l[i] = j
    return l

